import Dashboard from "./components/Dashboard";
import {Routes,Route,BrowserRouter} from 'react-router-dom'
const App = () => {


  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Dashboard/>} /> 

        </Routes>
      </BrowserRouter>
    </div>
  );
};
export default App;
